theme.css:
body {
  background-color: rgb(0, 0, 0);
}

.cell {
  background-color: rgb(235, 255, 153);
}

.year-break-left {
  border-left-color: rgb(40, 160, 24);
}

.x-mark {
  stroke: rgb(255, 0, 0);
}

.chain-title {
  color: rgb(117, 240, 164);
}

.chain table th:first-child {
  background-color: rgb(128, 134, 147);
}

.chain table tr:first-child th {
  background-color: rgb(138, 138, 138);
}

.chain-tab {
  color: rgb(73, 60, 60);
}

input {
  background-color: rgb(232, 240, 168);
}

.ring-number-box {
  background-color: rgba(110, 44, 175, 0.34);
  border-top-color: rgba(83, 30, 148, 0.62);
  border-right-color: rgba(83, 30, 148, 0.62);
  border-bottom-color: rgba(83, 30, 148, 0.62);
  border-left-color: rgba(83, 30, 148, 0.62);
  border-color: rgba(83, 30, 148, 0.62);
}

button {
  background-color: rgb(164, 183, 113);
}

.text-total-chain {
  color: rgb(73, 162, 77);
}

#show-count {
  color: rgb(210, 133, 91);
}

.parenthesis {
  color: rgb(127, 164, 204);
}

#btn-add-chain:hover {
  background-color: rgba(229, 156, 72, 0.5);
}

#btn-add-chain {
  color: rgb(149, 65, 9);
  border-top-color: rgb(162, 89, 22);
  border-right-color: rgb(162, 89, 22);
  border-bottom-color: rgb(162, 89, 22);
  border-left-color: rgb(162, 89, 22);
  border-color: rgb(162, 89, 22);
}

.form-titles {
  color: rgb(20, 7, 49);
}

.selections label {
  color: rgb(196, 151, 151);
  border-top-color: rgb(73, 228, 17);
  border-right-color: rgb(73, 228, 17);
  border-bottom-color: rgb(73, 228, 17);
  border-left-color: rgb(73, 228, 17);
  border-color: rgb(73, 228, 17);
}

label:has(input:checked) {
  color: rgb(228, 226, 226);
}

.extra-info {
  color: rgb(182, 191, 59);
}

.size-box > * {
  border-top-color: rgb(99, 161, 140);
  border-right-color: rgb(99, 161, 140);
  border-bottom-color: rgb(99, 161, 140);
  border-left-color: rgb(99, 161, 140);
  border-color: rgb(99, 161, 140);
}

#btn-backup-download {
  color: rgb(38, 95, 27);
  border-top-color: rgb(81, 133, 46);
  border-right-color: rgb(81, 133, 46);
  border-bottom-color: rgb(81, 133, 46);
  border-left-color: rgb(81, 133, 46);
  border-color: rgb(81, 133, 46);
}

#btn-reset {
  color: rgb(204, 199, 40);
  border-top-color: rgb(242, 235, 13);
  border-right-color: rgb(242, 235, 13);
  border-bottom-color: rgb(242, 235, 13);
  border-left-color: rgb(242, 235, 13);
  border-color: rgb(242, 235, 13);
}

.question-mark {
  color: rgba(116, 114, 114, 0.5);
}

.main-title {
  color: rgb(170, 73, 9);
}

.btn-toggle-menu {
  color: rgb(183, 94, 11);
  border-top-color: rgb(221, 83, 8);
  border-right-color: rgb(221, 83, 8);
  border-bottom-color: rgb(221, 83, 8);
  border-left-color: rgb(221, 83, 8);
  border-color: rgb(221, 83, 8);
}

.chain-info {
  color: rgb(14, 67, 37);
}

#btn-load-file {
  color: rgb(22, 78, 162);
}
